import React from "react";

const Login = () => {

    return (
        <div  className="d-flex"
      style={{
        minHeight: "100vh",
        overflow: "hidden",
        backgroundColor: "hsl(215, 30%, 10%)",
        color: "hsl(210, 40%, 98%)",
      }}>
        <div className="container d-flex justify-content-center align-items-center borderColor" style={{ minHeight: "100vh" }}  >
            <div className="card p-4 " style={{
                backgroundColor: "hsl(215, 25%, 14%)",
                color: "hsl(210, 40%, 98%)",
                border: "1px solid hsl(215, 20%, 25%)",
                width: "60%",}}>
                <h2 className="mb-4 text-center">Login</h2>
                <form>
                    <div className="mb-3"> 
                        <label htmlFor="email" className="form-label">Email address</label>
                        <input type="email" className="form-control" id="email" placeholder="Enter email" style={{
                            backgroundColor: "hsl(215, 25%, 12%)",
                            color: "hsl(210, 40%, 98%)",
                            border: "1px solid hsl(215, 20%, 25%)",
                        }}/>        
                    </div>      
                    <div className="mb-3">  
                        <label htmlFor="password" className="form-label">Password</label>
                        <input type="password" className="form-control" id="password" placeholder="Password" style={{
                            backgroundColor: "hsl(215, 25%, 12%)",  
                            color: "hsl(210, 40%, 98%)",
                            border: "1px solid hsl(215, 20%, 25%)",
                          
                        }}/>        
                    </div>  
                    <button type="submit" className="btn w-100" style={{
                        backgroundColor: "hsl(210, 40%, 50%)",
                        color: "hsl(215, 25%, 12%)",            
                        border: "1px solid hsl(215, 20%, 25%)",
                          width:"30%"
                    }}>Login</button>
                </form> 
                <div className="d-flex justify-content-end mt-3 p-4" style={{ cursor: "pointer",
                    color: "hsl(210, 40%, 80%)",
                 }}>
                    <p>Don't have account? <span className="bg">REGISTER</span></p>
                </div>
                </div>
                
        </div>

        </div>
    )
}
export default Login;
